import React from "react";
import { Col, Container, Row } from "react-bootstrap";
import { Icon } from "@iconify/react";

const Home = () => {
  return (
    <>
      <Container>
        <div className="box">
          <Row>
            <Col xl={8} sm={8}>
              <h2>
                FRONT-END REACT <br />
                DEVELOPER
              </h2>
              <h6>
                hi',i'm shubham chikhale.A passianate front-end react developer
                from pune,maharashtra.<Icon style={{"color":""}} icon="openmoji:location-indicator" />
              </h6>
            </Col>
            <Col xl={4} sm={4}>
              <img
                src="./Images/My-img.jpg"
                className="profile"
                alt="profile"
              />
            </Col>
          </Row>
        </div>
      </Container>
    </>
  );
};

export default Home;
